<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1531_%D0%B3%D0%BE%D0%B4\" title=\"1531 \u0433\u043e\u0434\">1531<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%9E%D0%B1%D0%B5%D1%80%D1%82%D1%8B%D0%BD%D0%B5\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041e\u0431\u0435\u0440\u0442\u044b\u043d\u0435\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041e\u0431\u0435\u0440\u0442\u044b\u043d\u0435<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B0\" title=\"\u041f\u043e\u043b\u044c\u0448\u0430\">\u041f\u043e\u043b\u044c\u0448\u0430<\/a> \u043f\u043e\u0431\u0435\u0434\u0438\u043b\u0430 \u0432\u0442\u0440\u043e\u0435 \u0431\u043e\u043b\u044c\u0448\u0435\u0435 \u0432\u043e\u0439\u0441\u043a\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BB%D0%B4%D0%B0%D0%B2%D0%B8%D1%8F\" title=\"\u041c\u043e\u043b\u0434\u0430\u0432\u0438\u044f\">\u041c\u043e\u043b\u0434\u0430\u0432\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1663_%D0%B3%D0%BE%D0%B4\" title=\"1663 \u0433\u043e\u0434\">1663<\/a>&#160;\u2014 \u0426\u0430\u0440\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B9_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0410\u043b\u0435\u043a\u0441\u0435\u0439 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0435\u0439 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447<\/a> \u0438\u0437\u0434\u0430\u043b \u0443\u043a\u0430\u0437 \u043e \u00ab\u0441\u0441\u044b\u043b\u043a\u0435 \u0432 \u0421\u0438\u0431\u0438\u0440\u044c \u043d\u0430 \u0432\u0435\u0447\u043d\u043e\u0435 \u0436\u0438\u0442\u044c\u0435 \u0441 \u0436\u0451\u043d\u0430\u043c\u0438 \u0438 \u0434\u0435\u0442\u044c\u043c\u0438 \u043f\u043e\u0434\u0434\u0435\u043b\u044c\u0449\u0438\u043a\u043e\u0432 \u043c\u043e\u043d\u0435\u0442\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1770_%D0%B3%D0%BE%D0%B4\" title=\"1770 \u0433\u043e\u0434\">1770<\/a>&#160;\u2014 \u041a\u0430\u043f\u0438\u0442\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%BA,_%D0%94%D0%B6%D0%B5%D0%B9%D0%BC%D1%81\" title=\"\u041a\u0443\u043a, \u0414\u0436\u0435\u0439\u043c\u0441\">\u0414\u0436\u0435\u0439\u043c\u0441 \u041a\u0443\u043a<\/a> \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0441\u0432\u043e\u0435\u0439 \u043f\u0435\u0440\u0432\u043e\u0439 \u043a\u0440\u0443\u0433\u043e\u0441\u0432\u0435\u0442\u043d\u043e\u0439 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u0438 \u0432\u044b\u0441\u0430\u0434\u0438\u043b\u0441\u044f \u043d\u0430 \u0432\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u043c \u043f\u043e\u0431\u0435\u0440\u0435\u0436\u044c\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u0438<\/a>, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u043d\u0430\u0437\u0432\u0430\u043b \u041d\u043e\u0432\u044b\u043c \u042e\u0436\u043d\u044b\u043c \u0423\u044d\u043b\u044c\u0441\u043e\u043c \u0438 \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u0432\u043b\u0430\u0434\u0435\u043d\u0438\u0435\u043c \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0439 \u043a\u043e\u0440\u043e\u043d\u044b. <\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1795_%D0%B3%D0%BE%D0%B4\" title=\"1795 \u0433\u043e\u0434\">1795<\/a>&#160;\u2014 \u0412\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D0%BD%D0%B2%D0%B5%D0%BD%D1%82\" title=\"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u043a\u043e\u043d\u0432\u0435\u043d\u0442\">\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u043c \u043a\u043e\u043d\u0432\u0435\u043d\u0442\u043e\u043c<\/a> \u043f\u0440\u0438\u043d\u044f\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%86%D0%B8%D1%8F_III_%D0%B3%D0%BE%D0%B4%D0%B0\" title=\"\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f III \u0433\u043e\u0434\u0430\">\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f III \u0433\u043e\u0434\u0430<\/a>, \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0443\u0442\u0432\u0435\u0440\u0434\u0438\u0432\u0448\u0430\u044f \u0432\u0441\u0435\u043e\u0431\u0449\u0435\u0435 \u0438\u0437\u0431\u0438\u0440\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1796_%D0%B3%D0%BE%D0%B4\" title=\"1796 \u0433\u043e\u0434\">1796<\/a>&#160;\u2014 \u043f\u043e\u0441\u043b\u0435 \u043d\u0435\u0434\u043e\u043b\u0433\u043e\u0433\u043e \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u044f \u0431\u0443\u0440\u0441\u043a\u0430\u044f <a href=\"https:\/\/nl.wikipedia.org\/wiki\/Republiek_Graaff-Reinet\" class=\"extiw\" title=\"nl:Republiek Graaff-Reinet\">\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0413\u0440\u0430\u0430\u0444-\u0420\u0435\u0439\u043d\u0435\u0442<\/a> \u043e\u043a\u043a\u0443\u043f\u0438\u0440\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0435\u0439<\/a> \u0438 \u0432\u043a\u043b\u044e\u0447\u0435\u043d\u0430 \u0432 \u0441\u043e\u0441\u0442\u0430\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BF%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BB%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u041a\u0430\u043f\u0441\u043a\u0430\u044f \u043a\u043e\u043b\u043e\u043d\u0438\u044f\">\u041a\u0430\u043f\u0441\u043a\u043e\u0439 \u043a\u043e\u043b\u043e\u043d\u0438\u0438<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1812_%D0%B3%D0%BE%D0%B4\" title=\"1812 \u0433\u043e\u0434\">1812<\/a>&#160;\u2014 \u042d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u044f \u0448\u0432\u0435\u0439\u0446\u0430\u0440\u0441\u043a\u043e\u0433\u043e \u0430\u0440\u0445\u0435\u043e\u043b\u043e\u0433\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D1%80%D0%BA%D1%85%D0%B0%D1%80%D0%B4%D1%82,_%D0%98%D0%BE%D0%B3%D0%B0%D0%BD%D0%BD_%D0%9B%D1%8E%D0%B4%D0%B2%D0%B8%D0%B3\" title=\"\u0411\u0443\u0440\u043a\u0445\u0430\u0440\u0434\u0442, \u0418\u043e\u0433\u0430\u043d\u043d \u041b\u044e\u0434\u0432\u0438\u0433\">\u0418\u043e\u0433\u0430\u043d\u043d\u0430 \u0411\u0443\u0440\u0445\u0430\u0440\u0434\u0442\u0430<\/a> \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0438\u043b\u0430 \u0432 180&#160;\u043a\u043c \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BC%D0%BC%D0%B0%D0%BD\" title=\"\u0410\u043c\u043c\u0430\u043d\">\u0410\u043c\u043c\u0430\u043d\u0430<\/a> \u0440\u0443\u0438\u043d\u044b \u0434\u0440\u0435\u0432\u043d\u0435\u0433\u043e \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D1%80%D0%B0\" title=\"\u041f\u0435\u0442\u0440\u0430\">\u041f\u0435\u0442\u0440\u0430<\/a>, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c, \u043f\u043e \u043f\u0440\u0435\u0434\u0430\u043d\u0438\u044e, \u041c\u043e\u0438\u0441\u0435\u0439 \u0434\u043e\u0431\u044b\u043b \u0432\u043e\u0434\u0443 \u0438\u0437 \u0441\u043a\u0430\u043b\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1818_%D0%B3%D0%BE%D0%B4\" title=\"1818 \u0433\u043e\u0434\">1818<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B5_%D0%B3%D0%B5%D1%80%D1%86%D0%BE%D0%B3%D1%81%D1%82%D0%B2%D0%BE_%D0%91%D0%B0%D0%B4%D0%B5%D0%BD\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0435 \u0433\u0435\u0440\u0446\u043e\u0433\u0441\u0442\u0432\u043e \u0411\u0430\u0434\u0435\u043d\">\u0412\u0435\u043b\u0438\u043a\u043e\u0435 \u0433\u0435\u0440\u0446\u043e\u0433\u0441\u0442\u0432\u043e \u0411\u0430\u0434\u0435\u043d<\/a> \u043f\u0440\u0438\u043d\u044f\u043b\u043e \u043b\u0438\u0431\u0435\u0440\u0430\u043b\u044c\u043d\u0443\u044e \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044e \u0432 \u043e\u0442\u0432\u0435\u0442 \u043d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0430\u043b\u044c\u043d\u044b\u0435 \u043f\u0440\u0435\u0442\u0435\u043d\u0437\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B2%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0411\u0430\u0432\u0430\u0440\u0438\u044f\">\u0411\u0430\u0432\u0430\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1845_%D0%B3%D0%BE%D0%B4\" title=\"1845 \u0433\u043e\u0434\">1845<\/a>&#160;\u2014 \u0417\u0430\u043a\u043b\u0430\u0434\u043a\u0430 \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0435\u0433\u043e \u0445\u0440\u0430\u043c\u0430 (\u0432\u0442\u043e\u0440\u043e\u0433\u043e \u043f\u043e \u0432\u0435\u043b\u0438\u0447\u0438\u043d\u0435 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438) <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D0%B5%D1%86_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)\" class=\"mw-redirect\" title=\"\u0415\u043b\u0435\u0446 (\u0433\u043e\u0440\u043e\u0434)\">\u0433. \u0415\u043b\u044c\u0446\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%BF%D0%B5%D1%86%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C\" title=\"\u041b\u0438\u043f\u0435\u0446\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c\">\u041b\u0438\u043f\u0435\u0446\u043a\u043e\u0439 \u043e\u0431\u043b.<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B7%D0%BD%D0%B5%D1%81%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80_(%D0%95%D0%BB%D0%B5%D1%86)\" title=\"\u0412\u043e\u0437\u043d\u0435\u0441\u0435\u043d\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440 (\u0415\u043b\u0435\u0446)\">\u0412\u043e\u0437\u043d\u0435\u0441\u0435\u043d\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u0431\u043e\u0440\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1846_%D0%B3%D0%BE%D0%B4\" title=\"1846 \u0433\u043e\u0434\">1846<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%9C%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D0%BE\" title=\"\u041d\u044c\u044e-\u041c\u0435\u043a\u0441\u0438\u043a\u043e\">\u041d\u044c\u044e-\u041c\u0435\u043a\u0441\u0438\u043a\u043e<\/a> \u0432\u043a\u043b\u044e\u0447\u0435\u043d\u043e \u0432 \u0441\u043e\u0441\u0442\u0430\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1849_%D0%B3%D0%BE%D0%B4\" title=\"1849 \u0433\u043e\u0434\">1849<\/a>&#160;\u2014 \u041e\u0441\u0430\u0436\u0434\u0430\u044e\u0449\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0412\u0435\u043d\u0435\u0446\u0438\u044f\">\u0412\u0435\u043d\u0435\u0446\u0438\u044e<\/a> \u0430\u0432\u0441\u0442\u0440\u0438\u0439\u0446\u044b \u0441\u0431\u0440\u0430\u0441\u044b\u0432\u0430\u044e\u0442 \u0441 \u0430\u044d\u0440\u043e\u0441\u0442\u0430\u0442\u043e\u0432 \u0437\u0430\u0436\u0438\u0433\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u0441\u043d\u0430\u0440\u044f\u0434\u044b, \u043f\u0440\u043e\u0432\u043e\u0434\u044f \u043f\u0435\u0440\u0432\u0443\u044e \u0431\u043e\u043c\u0431\u0430\u0440\u0434\u0438\u0440\u043e\u0432\u043a\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1851_%D0%B3%D0%BE%D0%B4\" title=\"1851 \u0433\u043e\u0434\">1851<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u0438<\/a> \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u044b \u0437\u043e\u043b\u043e\u0442\u044b\u0435 \u043c\u0435\u0441\u0442\u043e\u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1864\" class=\"mw-redirect\" title=\"1864\">1864<\/a>&#160;\u2014 \u041f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B5%D0%BD%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B5_%D0%BA%D0%BE%D0%BD%D0%B2%D0%B5%D0%BD%D1%86%D0%B8%D0%B8\" title=\"\u0416\u0435\u043d\u0435\u0432\u0441\u043a\u0438\u0435 \u043a\u043e\u043d\u0432\u0435\u043d\u0446\u0438\u0438\">\u0416\u0435\u043d\u0435\u0432\u0441\u043a\u0430\u044f \u043a\u043e\u043d\u0432\u0435\u043d\u0446\u0438\u044f<\/a><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1865_%D0%B3%D0%BE%D0%B4\" title=\"1865 \u0433\u043e\u0434\">1865<\/a>&#160;\u2014 \u0423\u0438\u043b\u044c\u044f\u043c \u0428\u0435\u043f\u043f\u0435\u0440\u0434 \u043f\u043e\u043b\u0443\u0447\u0430\u0435\u0442 \u043f\u0430\u0442\u0435\u043d\u0442 \u043d\u0430 \u0436\u0438\u0434\u043a\u043e\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8B%D0%BB%D0%BE\" title=\"\u041c\u044b\u043b\u043e\">\u043c\u044b\u043b\u043e<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1906_%D0%B3%D0%BE%D0%B4\" title=\"1906 \u0433\u043e\u0434\">1906<\/a>&#160;\u2014 \u041a\u0443\u0431\u0438\u043d\u0441\u043a\u0438\u0435 \u0431\u0438\u0437\u043d\u0435\u0441\u043c\u0435\u043d\u044b \u043e\u0431\u0440\u0430\u0442\u0438\u043b\u0438\u0441\u044c \u043a \u0421\u0428\u0410 \u0441 \u043f\u0440\u043e\u0441\u044c\u0431\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%BD%D0%B5%D0%BA%D1%81%D0%B8%D1%8F\" title=\"\u0410\u043d\u043d\u0435\u043a\u0441\u0438\u044f\">\u0430\u043d\u043d\u0435\u043a\u0441\u0438\u0440\u043e\u0432\u0430\u0442\u044c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%B1%D0%B0\" title=\"\u041a\u0443\u0431\u0430\">\u041a\u0443\u0431\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1909_%D0%B3%D0%BE%D0%B4\" title=\"1909 \u0433\u043e\u0434\">1909<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B9%D0%BC%D1%81\" title=\"\u0420\u0435\u0439\u043c\u0441\">\u0420\u0435\u0439\u043c\u0441\u0435<\/a> \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u043f\u0435\u0440\u0432\u043e\u0435 \u0432 \u043c\u0438\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D0%B8%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%BD%D0%BE%D0%B5_%D1%88%D0%BE%D1%83\" title=\"\u0410\u0432\u0438\u0430\u0446\u0438\u043e\u043d\u043d\u043e\u0435 \u0448\u043e\u0443\">\u0430\u0432\u0438\u0430\u0448\u043e\u0443<\/a> (\u0441 22 \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/29_%D0%B0%D0%B2%D0%B3%D1%83%D1%81%D1%82%D0%B0\" title=\"29 \u0430\u0432\u0433\u0443\u0441\u0442\u0430\">29 \u0430\u0432\u0433\u0443\u0441\u0442\u0430<\/a>). \u0414\u043b\u044f \u0443\u0447\u0430\u0441\u0442\u0438\u044f \u0432 \u0441\u043e\u0441\u0442\u044f\u0437\u0430\u043d\u0438\u044f\u0445 \u0431\u044b\u043b\u0438 \u0437\u0430\u044f\u0432\u043b\u0435\u043d\u044b 38 \u0430\u044d\u0440\u043e\u043f\u043b\u0430\u043d\u043e\u0432, \u043d\u043e \u0432\u0437\u043b\u0435\u0442\u0435\u0442\u044c \u0441\u043c\u043e\u0433\u043b\u0438 \u0442\u043e\u043b\u044c\u043a\u043e 23 \u043c\u0430\u0448\u0438\u043d\u044b. \u041c\u0438\u0442\u0438\u043d\u0433 \u043f\u0440\u0438\u0432\u043b\u0451\u043a \u0430\u0432\u0438\u0430\u0442\u043e\u0440\u043e\u0432 \u0438 \u0430\u0432\u0438\u0430\u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0442\u043e\u0440\u043e\u0432 \u0441\u043e \u0432\u0441\u0435\u0439 \u0415\u0432\u0440\u043e\u043f\u044b \u0438 \u043f\u0440\u043e\u0431\u0443\u0434\u0438\u043b \u0431\u043e\u043b\u044c\u0448\u043e\u0439 \u0438\u043d\u0442\u0435\u0440\u0435\u0441 \u043a \u0430\u0432\u0438\u0430\u0446\u0438\u0438 \u0443 \u0448\u0438\u0440\u043e\u043a\u043e\u0439 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u0438. \u041f\u043e\u043b\u0451\u0442\u044b \u0432 \u0420\u0435\u0439\u043c\u0441\u0435 \u0441\u043e\u0432\u0435\u0440\u0448\u0430\u043b\u0438 \u0430\u044d\u0440\u043e\u043f\u043b\u0430\u043d\u044b \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0445 \u0442\u0438\u043f\u043e\u0432: \u00ab\u0410\u043d\u0442\u0443\u0430\u043d\u0435\u0442\u0442\u00bb, \u00ab\u0411\u043b\u0435\u0440\u0438\u043e XI\u00bb, \u00ab\u0411\u043b\u0435\u0440\u0438\u043e XII\u00bb, \u00ab\u0411\u043b\u0435\u0440\u0438\u043e XIII\u00bb, \u00ab\u0411\u0440\u0435\u0433\u0435\u00bb, \u00ab\u041a\u0435\u0440\u0442\u0438\u0441\u0441\u00bb, \u00ab\u0410\u043d\u0440\u0438 \u0424\u0430\u0440\u043c\u0430\u043d\u00bb, REP, \u00ab\u0412\u0443\u0430\u0437\u0435\u043d\u00bb \u0438 \u00ab\u0420\u0430\u0439\u0442\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1910_%D0%B3%D0%BE%D0%B4\" title=\"1910 \u0433\u043e\u0434\">1910<\/a>&#160;\u2014 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80_%D0%BE_%D0%BF%D1%80%D0%B8%D1%81%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D0%B5%D0%BD%D0%B8%D0%B8_%D0%9A%D0%BE%D1%80%D0%B5%D0%B8_%D0%BA_%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D0%B8\" title=\"\u0414\u043e\u0433\u043e\u0432\u043e\u0440 \u043e \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0438 \u041a\u043e\u0440\u0435\u0438 \u043a \u042f\u043f\u043e\u043d\u0438\u0438\">\u0414\u043e\u0433\u043e\u0432\u043e\u0440 \u043e \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0438 \u041a\u043e\u0440\u0435\u0438 \u043a \u042f\u043f\u043e\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1911_%D0%B3%D0%BE%D0%B4\" title=\"1911 \u0433\u043e\u0434\">1911<\/a>&#160;\u2014 \u0412 \u0410\u043d\u0433\u043b\u0438\u0438 \u043f\u0440\u0438\u043d\u044f\u0442 \u0441\u0435\u043a\u0440\u0435\u0442\u043d\u044b\u0439 \u0437\u0430\u043a\u043e\u043d, \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0430\u044e\u0449\u0438\u0439 \u043f\u0440\u0435\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435\u043c \u043f\u0443\u0431\u043b\u0438\u043a\u0430\u0446\u0438\u044e \u0431\u0435\u0437 \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043d\u0438\u044f \u043b\u044e\u0431\u043e\u0439 \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0439 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1914_%D0%B3%D0%BE%D0%B4\" title=\"1914 \u0433\u043e\u0434\">1914<\/a>&#160;\u2014 \u0412 \u0420\u043e\u0441\u0441\u0438\u0438 \u043d\u0430 \u043f\u0435\u0440\u0438\u043e\u0434 \u0432\u043e\u0439\u043d\u044b \u0437\u0430\u043f\u0440\u0435\u0449\u0435\u043d\u0430 \u043f\u0440\u043e\u0434\u0430\u0436\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%BA%D0%BE%D0%B3%D0%BE%D0%BB%D1%8C%D0%BD%D1%8B%D0%B5_%D0%BD%D0%B0%D0%BF%D0%B8%D1%82%D0%BA%D0%B8\" title=\"\u0410\u043b\u043a\u043e\u0433\u043e\u043b\u044c\u043d\u044b\u0435 \u043d\u0430\u043f\u0438\u0442\u043a\u0438\">\u0441\u043f\u0438\u0440\u0442\u043d\u044b\u0445 \u043d\u0430\u043f\u0438\u0442\u043a\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 \u0412 \u0441\u043e\u0441\u0442\u0430\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%B0%D1%8F_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0424\u0435\u0434\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u0430\u044f \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0420\u0421\u0424\u0421\u0420<\/a> \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%82%D0%BE%D0%BD%D0%BE%D0%BC%D0%BD%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C_%D0%9A%D0%BE%D0%BC%D0%B8_(%D0%97%D1%8B%D1%80%D1%8F%D0%BD)\" title=\"\u0410\u0432\u0442\u043e\u043d\u043e\u043c\u043d\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c \u041a\u043e\u043c\u0438 (\u0417\u044b\u0440\u044f\u043d)\">\u041a\u043e\u043c\u0438 (\u0417\u044b\u0440\u044f\u043d) \u0430\u0432\u0442\u043e\u043d\u043e\u043c\u043d\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1932_%D0%B3%D0%BE%D0%B4\" title=\"1932 \u0433\u043e\u0434\">1932<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8-%D0%B1%D0%B8-%D1%81%D0%B8\" title=\"\u0411\u0438-\u0431\u0438-\u0441\u0438\">\u0411\u0438-\u0411\u0438-\u0421\u0438<\/a> \u043d\u0430\u0447\u0430\u043b\u0430 \u044d\u043a\u0441\u043f\u0435\u0440\u0438\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u043e\u0435 \u0442\u0435\u043b\u0435\u0432\u0435\u0449\u0430\u043d\u0438\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B3%D0%B0\" title=\"\u041f\u0440\u0430\u0433\u0430\">\u041f\u0440\u0430\u0433\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0441\u044f \u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 \u0441\u0438\u043e\u043d\u0438\u0441\u0442\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939<\/a>&#160;\u2014 \u0420\u0435\u043a\u043e\u0440\u0434\u043d\u044b\u0439 \u0437\u0430\u043f\u043b\u044b\u0432 \u041c. \u0420\u0435\u0439\u0437\u0435\u043d\u0430 (\u043c\u0430\u0441\u0442\u0435\u0440\u0430 \u0441\u043f\u043e\u0440\u0442\u0430). \u0417\u0430\u043f\u043b\u044b\u0432 \u0431\u044b\u043b \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043b\u0451\u043d \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BB%D0%B8%D1%81%D1%81%D0%B5%D0%BB%D1%8C%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0428\u043b\u0438\u0441\u0441\u0435\u043b\u044c\u0431\u0443\u0440\u0433\">\u0428\u043b\u0438\u0441\u0441\u0435\u043b\u044c\u0431\u0443\u0440\u0433\u0430<\/a> \u0434\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%BD%D0%B0%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D1%8C\" title=\"\u0421\u0435\u043d\u0430\u0442\u0441\u043a\u0430\u044f \u043f\u043b\u043e\u0449\u0430\u0434\u044c\">\u043f\u043b. \u0414\u0435\u043a\u0430\u0431\u0440\u0438\u0441\u0442\u043e\u0432<\/a>, \u043f\u0440\u043e\u0442\u044f\u0436\u0451\u043d\u043d\u043e\u0441\u0442\u044c 69&#160;\u043a\u043c, \u0437\u0430\u0442\u0440\u0430\u0447\u0435\u043d\u043d\u043e\u0435 \u0432\u0440\u0435\u043c\u044f 13 \u0447. 11&#160;\u043c, \u0442\u0435\u043c\u043f\u0435\u0440\u0430\u0442\u0443\u0440\u0430 \u0432\u043e\u0434\u044b + 17\u00b0\u0421. <\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a>&#160;\u2014 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D0%BB%D1%8F%D0%B1%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D1%80%D0%B0%D0%BA%D1%82%D0%BE%D1%80%D0%BD%D1%8B%D0%B9_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4\" title=\"\u0427\u0435\u043b\u044f\u0431\u0438\u043d\u0441\u043a\u0438\u0439 \u0442\u0440\u0430\u043a\u0442\u043e\u0440\u043d\u044b\u0439 \u0437\u0430\u0432\u043e\u0434\">\u041a\u0438\u0440\u043e\u0432\u0441\u043a\u043e\u043c \u0437\u0430\u0432\u043e\u0434\u0435<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D0%BB%D1%8F%D0%B1%D0%B8%D0%BD%D1%81%D0%BA\" title=\"\u0427\u0435\u043b\u044f\u0431\u0438\u043d\u0441\u043a\">\u0427\u0435\u043b\u044f\u0431\u0438\u043d\u0441\u043a\u0435<\/a> \u043d\u0430\u0447\u0430\u0442\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D0%B2%D0%B5%D0%B9%D0%B5%D1%80\" title=\"\u041a\u043e\u043d\u0432\u0435\u0439\u0435\u0440\">\u043a\u043e\u043d\u0432\u0435\u0439\u0435\u0440\u043d\u043e\u0435<\/a> \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0441\u0442\u0432\u043e \u0442\u0430\u043d\u043a\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2-34\" title=\"\u0422-34\">\u0422-34<\/a> .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944_%D0%B3%D0%BE%D0%B4\" title=\"1944 \u0433\u043e\u0434\">1944<\/a>&#160;\u2014 \u0432 \u0443\u0447\u0435\u0431\u043d\u044b\u0445 \u0437\u0430\u0432\u0435\u0434\u0435\u043d\u0438\u044f\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u0438<\/a> \u043e\u0442\u043c\u0435\u043d\u0435\u043d\u044b \u0437\u0430\u043d\u044f\u0442\u0438\u044f, \u0434\u0435\u0442\u0438 \u043f\u0440\u0438\u0437\u0432\u0430\u043d\u044b \u043d\u0430 \u0444\u0430\u0431\u0440\u0438\u043a\u0438 \u0438 \u0437\u0430\u0432\u043e\u0434\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1948_%D0%B3%D0%BE%D0%B4\" title=\"1948 \u0433\u043e\u0434\">1948<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B0\" title=\"\u041f\u043e\u043b\u044c\u0448\u0430\">\u041f\u043e\u043b\u044c\u0448\u0435<\/a> \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u043e \u043d\u0430\u0447\u0430\u043b\u043e \u043a\u043e\u043b\u043b\u0435\u043a\u0442\u0438\u0432\u0438\u0437\u0430\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1956_%D0%B3%D0%BE%D0%B4\" title=\"1956 \u0433\u043e\u0434\">1956<\/a>&#160;\u2014 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u043f\u0435\u0432\u0435\u0446 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D1%81%D0%BB%D0%B8,_%D0%AD%D0%BB%D0%B2%D0%B8%D1%81\" title=\"\u041f\u0440\u0435\u0441\u043b\u0438, \u042d\u043b\u0432\u0438\u0441\">\u042d\u043b\u0432\u0438\u0441 \u041f\u0440\u0435\u0441\u043b\u0438<\/a> \u043d\u0430\u0447\u0430\u043b \u0441\u043d\u0438\u043c\u0430\u0442\u044c\u0441\u044f \u0432 \u0441\u0432\u043e\u0451\u043c \u043f\u0435\u0440\u0432\u043e\u043c \u0444\u0438\u043b\u044c\u043c\u0435 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%91%D1%80%D0%B0%D1%82%D1%8C%D1%8F_%D0%A0%D0%B5%D0%BD%D0%BE&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0411\u0440\u0430\u0442\u044c\u044f \u0420\u0435\u043d\u043e (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0411\u0440\u0430\u0442\u044c\u044f \u0420\u0435\u043d\u043e<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1961_%D0%B3%D0%BE%D0%B4\" title=\"1961 \u0433\u043e\u0434\">1961<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B6%D0%B4%D1%83%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9_%D0%B0%D1%81%D1%82%D1%80%D0%BE%D0%BD%D0%BE%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D1%8E%D0%B7\" title=\"\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u0430\u0441\u0442\u0440\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0441\u043e\u044e\u0437\">\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u0430\u0441\u0442\u0440\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0441\u043e\u044e\u0437<\/a> \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u0443\u0442\u0432\u0435\u0440\u0434\u0438\u043b \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u044f \u0434\u0435\u0442\u0430\u043b\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B1%D1%80%D0%B0%D1%82%D0%BD%D0%B0%D1%8F_%D1%81%D1%82%D0%BE%D1%80%D0%BE%D0%BD%D0%B0_%D0%9B%D1%83%D0%BD%D1%8B\" title=\"\u041e\u0431\u0440\u0430\u0442\u043d\u0430\u044f \u0441\u0442\u043e\u0440\u043e\u043d\u0430 \u041b\u0443\u043d\u044b\">\u043e\u0431\u0440\u0430\u0442\u043d\u043e\u0439 \u0441\u0442\u043e\u0440\u043e\u043d\u044b \u041b\u0443\u043d\u044b<\/a>, \u0441\u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%82%D0%BE%D0%BC%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BC%D0%B5%D0%B6%D0%BF%D0%BB%D0%B0%D0%BD%D0%B5%D1%82%D0%BD%D0%B0%D1%8F_%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0410\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043c\u0435\u0436\u043f\u043b\u0430\u043d\u0435\u0442\u043d\u0430\u044f \u0441\u0442\u0430\u043d\u0446\u0438\u044f\">\u0410\u041c\u0421<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%BD%D0%B0-3\" title=\"\u041b\u0443\u043d\u0430-3\">\u041b\u0443\u043d\u0430-3<\/a>\u00bb. <\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1962_%D0%B3%D0%BE%D0%B4\" title=\"1962 \u0433\u043e\u0434\">1962<\/a>&#160;\u2014 \u041e\u0442\u043f\u0440\u0430\u0432\u0438\u043b\u0430\u0441\u044c \